import React from 'react';


const History = ({ user }) => {

    fetch(`http://localhost:3000/history`, {
        method: 'GET',
        headers: {'Content-Type': 'application/json'},
        body: JSON.stringify({
            id: user.id
        })
    })
    .then(response => response.json())
    .then(puncharray =>{
        if (puncharray[0]){
            return(
                puncharray.map((item, index) => {
                    return(
                    <p key={index}>{item}</p>
                    )
                })
            )
        } else {
            return (
                <div>
                    <p>You have no punches</p>
                </div>
            )
        }
    })
    .catch(err => console.log(err));


    return(
        <div>
            <p>hi</p>
        </div>
    )
}

export default History;
